import React from "react";
import {
  HSLSliderProvider,
  HueSlider,
  SaturationSlider,
  LightnessSlider,
} from "material-ui-color-sliders";
import Typography from "@material-ui/core/Typography";

export default () => (
  <>
    <Typography variant="h3">HSL</Typography>
    <HSLSliderProvider>
      <HueSlider
        style={{ margin: "32px 128px", width: "calc(100% - 256px)" }}
      />
      <SaturationSlider
        style={{ margin: "32px 128px", width: "calc(100% - 256px)" }}
      />
      <LightnessSlider
        style={{ margin: "32px 128px", width: "calc(100% - 256px)" }}
      />
    </HSLSliderProvider>
  </>
);
